import ExpenseItem from "./ExpenseItem";
import "./components/Expenses.css";

function Expenses(props) {
  const item = props.expensesItem;
  return (
    <div className="expenses">
      <ExpenseItem
        title={item.title}
        amount={item.amount}
        date={item.date}
      ></ExpenseItem>
      <ExpenseItem
