        title={item.title}
        amount={item.amount}
        date={item.date}
      ></ExpenseItem>
      <ExpenseItem
        title={item.title}
        amount={item.amount}
        date={item.date}
      ></ExpenseItem>
      <ExpenseItem
        title={item.title}
        amount={item.amount}
        date={item.date}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
